import {MemberProvider} from "./Context"; 
import {
	Route,
  HashRouter,

 }
 from "react-router-dom";

ReactDOM.render(
  <MemberProvider>
  	<HashRouter>
  		<Main/> 
  	</HashRouter>
  </MemberProvider>,
  document.getElementById("root")
);
